--
-- Database: `question_recommendation`
--
CREATE DATABASE IF NOT EXISTS `question_recommendation` DEFAULT CHARACTER SET utf8 COLLATE utf8_bin;
USE `question_recommendation`;

-- --------------------------------------------------------

--
-- 表的结构 `clusters`
--

DROP TABLE IF EXISTS `clusters`;
CREATE TABLE IF NOT EXISTS `clusters` (
  `cluster_name` varchar(6) COLLATE utf8_bin NOT NULL DEFAULT 'k-i' COMMENT 'k总簇数-i簇号[1,k]',
  `subject_id_join` mediumtext COLLATE utf8_bin NOT NULL COMMENT '所有试题id拼接后的字符串',
  PRIMARY KEY (`cluster_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

