--
-- 表的结构 `records`
--

DROP TABLE IF EXISTS `records`;
CREATE TABLE IF NOT EXISTS `records` (
  `subject_id` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '试题在牛客网的id',
  `subject_title` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '试题的标题',
  `subject_answers_id_join` mediumtext COLLATE utf8_bin NOT NULL COMMENT '拼接试题的所有回答者id',
  PRIMARY KEY (`subject_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

